/* Navbar container */
.navbar {
    overflow: hidden;
    font-family: Segoe UI, Helvetica, Arial, sans-serif;
    z-index: 1000000 !important;
}

/* Links inside the navbar */
.navbar a {
    float: left;
    color: #979797;
    text-align: center;
    padding: 9px 16px;
    text-decoration: none;

}
.navbar .active-page a {
    color: white;
}

/* The dropdown container */
.dropdown {
    float: left;
    overflow: hidden;
    z-index: 999 !important;
}

/* Dropdown button */
.dropdown .dropbtn {
    border: none;
    outline: none;
    color: #979797;
    padding: 9px 16px;
    background-color: inherit;
    z-index: 999;
    /* Important for vertical align on mobile phones */
    font-family: inherit;
    margin: 0;
}

/* Add a background color to navbar links on hover */
.navbar a:hover,
.dropdown:hover .dropbtn {
    //background-color: rgba(58, 159, 199, 0.1);
    background-color: rgba(255, 155, 0, 0.1) !important;
    height:100%;
    z-index: 999;

}

/* Add a background color to navbar links after clicking */
.navbar a::after,
.dropdown::after .dropbtn {
    background-color: rgba(58, 159, 199, 0.467) !important;
    border-bottom: 2px solid #25a9e0;
    z-index: 999;
    border-color: #25a9e0 !important;
}

/* Dropdown content (hidden by default) */
.dropdown-content {
    display: none;
    position: fixed;
    background-color: #313131;
    min-width: 160px;
    box-shadow: 0px 8px 16px 0px rgba(0, 0, 0, 0.2);
    z-index: 999;
}

/* Links inside the dropdown */
.dropdown-content a {
    float: none;
    color: #bababa;
    padding: 7px 16px;
    text-decoration: none;
    display: block;
    text-align: left;
    border-left: 2px solid transparent;
}

/* Add a blue hue background color to dropdown links on hover */
.dropdown-content a:hover {
  //  background-color: rgba(58, 159, 199, 0.1);
    border-bottom: none;
    //border-left: 2px solid #25a9e0;

    border-left: 2px solid #ffc300 !important;
     background-color: rgba(255, 155, 0, 0.1) !important;
}

/* Show the dropdown menu on hover */
.dropdown:hover .dropdown-content {
    display: block;
    z-index: 999 !important;
}

