.invSlider {
    width: 80px !important;
}

.panel .chartSlider div.basicComponents_radio > div > div.align-div > div > div.radio_buttons.horizontal > div > input {
	display: none;
}
.panel .chartSlider div.basicComponents_radio {
	border: solid 1px;
	border-radius: 80px;
	width: calc(100% - 3px);
	margin: 0;
	height:24px;
}
.panel .chartSlider div.basicComponents_radio.Dark {
	background:transparent;
	border-color: #505050;
}
.panel .chartSlider div.basicComponents_radio > div > div.align-div > div > div.radio_buttons.horizontal > div {
	width: 20px;
	border-radius: 120px;
}
.panel .chartSlider div.basicComponents_radio > div input {
	position: absolute !important;
	clip: rect(0, 0, 0, 0);
	height: 1px;
	width: 1px;
	border: 1px;
	overflow: hidden;	
}
.panel .chartSlider div.basicComponents_radio > div label {
	float: left;
	margin-top: 2px;
	margin-left: 1.7px;
}
.panel .chartSlider div.basicComponents_radio > div input:checked + label {
	background: linear-gradient(to bottom, #ffffff 40%, #f0f0f0);
  background-image: -webkit-linear-gradient(top, #ffffff 40%, #f0f0f0);
  border-radius: 100%;
	width:20px;
	height:20px;
	position: absolute;
  top: 0px;
  box-shadow: -1px 1px 5px rgba(0, 0, 0, 0.2);
	font-size: 0.1px;
}
.panel .chartSlider div.basicComponents_radio > div input:checked + label::before {
	content: "";
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -6px 0 0 -6px;
  width: 12px;
  height: 12px;
  background: linear-gradient(to bottom, #eeeeee, #ffffff);
  background-image: -webkit-linear-gradient(top, #eeeeee, #ffffff);
  border-radius: 6px;
  box-shadow: inset 0 1px rgba(0, 0, 0, 0.02);
}
.panel .chartSlider .radio_buttons > div > label {
	font-size:10px;
	width:100px;
}
.panel .chartSlider .radio_buttons > div:last-child > label {
	right: 2px
}

